/1862_%D0%B3%D0%BE%D0%B4\" title=\"1862 \u0433\u043e\u0434\">1862<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8C%D1%8E%D0%B8%D1%81_%D0%9A%D1%8D%D1%80%D1%80%D0%BE%D0%BB%D0%BB\" title=\"\u041b\u044c\u044e\u0438\u0441 \u041a\u044d\u0440\u0440\u043e\u043b\u043b\">\u041b\u044c\u044e\u0438\u0441 \u041a\u044d\u0440\u0440\u043e\u043b\u043b<\/a> \u0441\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u0435\u0442 \u043e\u0431\u0435\u0449\u0430\u043d\u0438\u0435, \u0434\u0430\u043d\u043d\u043e\u0435 \u0440\u0430\u043d\u0435\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B4%D0%B4%D0%B5%D0%BB,_%D0%90%D0%BB%D0%B8%D1%81%D0%B0_%D0%9F%D0%BB%D0%B5%D0%B7%D0%B5%D0%BD%D1%81\" class=\"mw-redirect\" title=\"\u041b\u0438\u0434\u0434\u0435\u043b, \u0410\u043b\u0438\u0441\u0430 \u041f\u043b\u0435\u0437\u0435\u043d\u0441\">\u0410\u043b\u0438\u0441\u0435 \u041b\u0438\u0434\u0434\u0435\u043b\u043b<\/a>, \u0437\u0430\u043f\u0438\u0441\u044b\u0432\u0430\u044f \u0432 \u0441\u0432\u043e\u0451\u043c \u0434\u043d\u0435\u0432\u043d\u0438\u043a\u0435: \u00ab\u041d\u0430\u0447\u0430\u043b \u043f\u0438\u0441\u0430\u0442\u044c \u0441\u043a\u0430\u0437\u043a\u0443 \u043e\u0431 \u0410\u043b\u0438\u0441\u0435, \u043d\u0430\u0434\u0435\u044e\u0441\u044c \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u0442\u044c \u0435\u0451 \u043a \u0420\u043e\u0436\u0434\u0435\u0441\u0442\u0432\u0443\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1872_%D0%B3%D0%BE%D0%B4\" title=\"1872 \u0433\u043e\u0434\">1872<\/a>&#160;\u2014 \u0412\u044b\u0448\u043b\u043e \u0432 \u0441\u0432\u0435\u0442 \u043f\u0435\u0440\u0432\u043e\u0435 \u0438\u0437\u0434\u0430\u043d\u0438\u0435 \u00ab\u0410\u0437\u0431\u0443\u043a\u0438\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BB%D1%81%D1%82%D0%BE%D0%B9,_%D0%9B%D0%B5%D0%B2_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0422\u043e\u043b\u0441\u0442\u043e\u0439, \u041b\u0435\u0432 \u041d\u0438\u043a\u043e\u