itle=\"1902 \u0433\u043e\u0434\">1902<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BD\" title=\"\u0418\u0440\u0430\u043d\">\u041f\u0435\u0440\u0441\u0438\u044f<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u044b\u0432\u0430\u0435\u0442 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0435\u0439<\/a> \u0414\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u043b\u044c\u0433\u043e\u0442\u043d\u044b\u0445 \u0442\u0430\u0440\u0438\u0444\u0430\u0445, \u0434\u0438\u0441\u043a\u0440\u0438\u043c\u0438\u043d\u0438\u0440\u0443\u044e\u0449\u0438\u0439 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0435 \u0442\u043e\u0432\u0430\u0440\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4\" title=\"1902 \u0433\u043e\u0434\">1902<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%80%D0%B8%D0%B6%D0%B0%D0%B1%D0%BB%D1%8C\" title=\"\u0414\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c\">\u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044f<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B1%D0%B5%D0%B4%D1%8C_(%D0%B4%D0%B8%D1%80%D0%B8%D0%B6%D0%B0%D0%B1%D0%BB%D1%8C)\" title=\"\u041b\u0435\u0431\u0435\u0434\u044c (\u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c)\">\u041b\u0435\u0431\u043e\u0434\u0438<\/a>\u00bb \u043f\u043e\u043b\u0443\u0436\u0451\u0441\u0442\u043a\u043e\u0439 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1907_%D0%B3%D0%BE%D0%B4\" title=\"1907 \u0433\u043e\u0434\">1907<\/a>&#160;\u2014 \u041d