D0%B9%D1%81_(%D1%88%D1%82%D0%B0%D1%82)\" class=\"mw-redirect\" title=\"\u0418\u043b\u043b\u0438\u043d\u043e\u0439\u0441 (\u0448\u0442\u0430\u0442)\">\u0418\u043b\u043b\u0438\u043d\u043e\u0439\u0441<\/a>, \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442 \u043e\u043a\u043e\u043b\u043e 250 \u0448\u0430\u0445\u0442\u0451\u0440\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 \u041d\u043e\u0432\u044b\u043c \u043b\u0438\u0434\u0435\u0440\u043e\u043c \u041a\u043e\u043d\u0441\u0435\u0440\u0432\u0430\u0442\u0438\u0432\u043d\u043e\u0439 \u0438 \u042e\u043d\u0438\u043e\u043d\u0438\u0441\u0442\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438 \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f \u042d\u043d\u0434\u0440\u044e \u0411\u043e\u043d\u0435\u0440 \u041b\u043e\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1913_%D0%B3%D0%BE%D0%B4\" title=\"1913 \u0433\u043e\u0434\">1913<\/a>&#160;\u2014 \u0417\u0430\u043a\u043b\u044e\u0447\u0430\u0435\u0442\u0441\u044f \u0433\u0440\u0435\u043a\u043e-\u0442\u0443\u0440\u0435\u0446\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440. \u0413\u0440\u0435\u043a\u0438 \u043f\u043e\u043b\u0443\u0447\u0430\u044e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B8%D1%82\" title=\"\u041a\u0440\u0438\u0442\">\u041a\u0440\u0438\u0442<\/a> \u0438 \u043e\u0441\u0442\u0440\u043e\u0432\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B3%D0%B5%D0%B9%D1%81%D0%BA%D0%BE%D0%B5_%D0%BC%D0%BE%D1%80%D0%B5\" title=\"\u042d\u0433\u0435\u0439\u0441\u043a\u043e\u0435 \u043c\u043e\u0440\u0435\">\u042d\u0433\u0435\u0439\u0441\u043a\u043e\u043c \u043c\u043e\u0440\u0435<\/a> \u043a\u0440\u043e\u043c\u0435 \u043e\u0441\u0442\u0440\u043e\u0432\u043e\u0432 \u0422\u0438\u043d\u0438\u0434\u043e\u0441, \u0418\u043c\u0431\u0440\u0434\u043e\u0441 \u0438 \u0414\u043e\u0434\u0435\u043a\u0430\u043d\u0435\u0441.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914<\/a>&#160;\u2014 \u0412 \u0421\u0428\u0410 \u041c\u0435\u0440\u0438 \u0424\u0435\u043b\u043f\u0441 \u0414\u0436\u0435\u043a\u043e\u0431\u0441 \u043f\u0430\u0442\u0435\u043d\u0442\u0443\u0435\u0442 \u043d\u043e\u0432\u044b\u0439 \u0436\u0435\u043d\u0441\u043a\u0438\u0439 \u043f\u0440\u0435\u0434\u043c\u0435\u0442 \u043d\u0438\u0436\u043d\u0435\u0433\u043e \u0431\u0435\u043b\u044c\u044f, \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u0439 \u043a\u0430\u043a \u00ab\u043b\u0438\u0444\u0447\u0438\u043a \u0431\u0435\u0437 \u0441\u043f\u0438\u043d\u043a\u0438\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1915_%D0%B3%D0%BE%D0%B4\" title=\"1915 \u0433\u043e\u0434\">1915<\/a>&#160;\u2014 \u041f\u043e\u0441\u043b\u0435 \u043f\u0440\u043e\u0432\u0430\u043b\u0430 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u0438 \u043d\u0430 \u0413\u0430\u043b\u043b\u0438\u043f\u043e\u043b\u044c\u0441\u043a\u043e\u043c \u043f\u043e\u043b\u0443\u043e\u0441\u0442\u0440\u043e\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%80%D1%87%D0%B8%D0%BB%D0%BB%D1%8C,_%D0%A3%D0%B8%D0%BD%D1%81%D1%82%D0%BE%D0%BD\" title=\"\u0427\u0435\u0440\u0447\u0438\u043b\u043b\u044c, \u0423\u0438\u043d\u0441\u0442\u043e\u043d\">\u0423\u0438\u043d\u0441\u0442\u043e\u043d \u0427\u0435\u0440\u0447\u0438\u043b\u043b\u044c<\/a> \u0432\u044b\u0445\u043e\u0434\u0438\u0442 \u0438\u0437 \u0441\u043e\u0441\u0442\u0430\u0432\u0430 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u0430\u0431\u0438\u043d\u0435\u0442\u0430 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1916_%D0%B3%D0%BE%D0%B4\" title=\"1916 \u0433\u043e\u0434\">1916<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u044c\u0433\u0438\u044f\">\u0411\u0435\u043b\u044c\u0433\u0438\u0438<\/a> \u043a\u0430\u0440\u0434\u0438\u043d\u0430\u043b \u041c\u0435\u0440\u0441\u044c\u0435, \u0430\u0440\u0445\u0438\u0435\u043f\u0438\u0441\u043a\u043e\u043f \u041c\u0430\u043b\u0438\u043d\u0441\u043a\u0438\u0439, \u0432\u044b\u0440\u0430\u0436\u0430\u0435\u0442 \u043f\u0440\u043e\u0442\u0435\u0441\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a> \u043f\u043e \u043f\u043e\u0432\u043e\u0434\u0443 \u043d\u0430\u0441\u0438\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0434\u0435\u043f\u043e\u0440\u0442\u0430\u0446\u0438\u0438 \u0438 \u043f\u0440\u0438\u043d\u0443\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0442\u0440\u0443\u0434\u0430 \u0431\u0435\u043b\u044c\u0433\u0438\u0439\u0446\u0435\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1916_%D0%B3%D0%BE%D0%B4\" title=\"1916 \u0433\u043e\u0434\">1916<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">I \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u0435<\/a> \u0437\u0430\u043a\u0430\u043d\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BD%D0%B0_%D0%A1%D0%BE%D0%BC%D0%BC%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043d\u0430 \u0421\u043e\u043c\u043c\u0435\">\u0431\u0438\u0442\u0432\u0430 \u043d\u0430 \u0421\u043e\u043c\u043c\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u0411\u0430\u043a\u0438\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0432\u0435\u0442 \u0431\u0435\u0440\u0451\u0442 \u0432\u043b\u0430\u0441\u0442\u044c \u0432 \u0441\u0432\u043e\u0438 \u0440\u0443\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u0420\u0430\u0437\u0433\u0440\u043e\u043c \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u044b\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%85%D0%BE%D0%B4_%D0%9A%D0%B5%D1%80%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%E2%80%94_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D0%B2%D0%B0_%D0%BD%D0%B0_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B3%D1%80%D0%B0%D0%B4\" class=\"mw-redirect\" title=\"\u041f\u043e\u0445\u043e\u0434 \u041a\u0435\u0440\u0435\u043d\u0441\u043a\u043e\u0433\u043e \u2014 \u041a\u0440\u0430\u0441\u043d\u043e\u0432\u0430 \u043d\u0430 \u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\">\u043c\u044f\u0442\u0435\u0436\u0430 \u041a\u0435\u0440\u0435\u043d\u0441\u043a\u043e\u0433\u043e&#160;\u2014 \u041a\u0440\u0430\u0441\u043d\u043e\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u043e \u0432\u0441\u0435\u043e\u0431\u0449\u0435\u0439 \u0437\u0430\u0431\u0430\u0441\u0442\u043e\u0432\u043a\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u044f\">\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u041e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u043e \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u0412\u0426\u0418\u041a \u043e\u0431 \u0430\u043d\u043d\u0443\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B5%D1%81%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80\" title=\"\u0411\u0440\u0435\u0441\u0442\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\">\u0411\u0440\u0435\u0441\u0442\u0441\u043a\u043e\u0433\u043e \u043c\u0438\u0440\u043d\u043e\u0433\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430<\/a> \u0432 \u0441\u0432\u044f\u0437\u0438 \u0441 \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a> \u0432 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82\" title=\"\u0415\u0433\u0438\u043f\u0435\u0442\">\u0415\u0433\u0438\u043f\u0442\u0435<\/a> \u0441\u043e\u0437\u0434\u0430\u0451\u0442\u0441\u044f \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f (\u043f\u0435\u0440\u0432\u043e\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e \u0434\u043b\u044f \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0435\u043d\u0438\u044f \u0443\u0447\u0430\u0441\u0442\u0438\u044f \u0434\u0435\u043b\u0435\u0433\u0430\u0446\u0438\u0438 \u0415\u0433\u0438\u043f\u0442\u0430 \u0432 \u041f\u0430\u0440\u0438\u0436\u0441\u043a\u043e\u0439 \u043c\u0438\u0440\u043d\u043e\u0439 \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0438).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_I_(%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b I (\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0410\u0432\u0441\u0442\u0440\u0438\u0438)\">\u041a\u0430\u0440\u043b I (\u041a\u0430\u0440\u043b IV)<\/a> \u043e\u0442\u0440\u0435\u043a\u0430\u0435\u0442\u0441\u044f \u043e\u0442 \u0432\u0435\u043d\u0433\u0435\u0440\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_%D0%90%D0%B2%D0%B3%D1%83%D1%81%D1%82_III_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A1%D0%B0%D0%BA%D1%81%D0%BE%D0%BD%D0%B8%D0%B8)\" title=\"\u0424\u0440\u0438\u0434\u0440\u0438\u0445 \u0410\u0432\u0433\u0443\u0441\u0442 III (\u043a\u043e\u0440\u043e\u043b\u044c \u0421\u0430\u043a\u0441\u043e\u043d\u0438\u0438)\">\u041a\u043e\u0440\u043e\u043b\u044c \u0421\u0430\u043a\u0441\u043e\u043d\u0438\u0438<\/a> \u043e\u0442\u0440\u0435\u043a\u0430\u0435\u0442\u0441\u044f \u043e\u0442 \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a> \u0441\u043e\u0437\u0434\u0430\u0451\u0442\u0441\u044f \u043f\u0440\u0430\u0432\u043e\u0440\u0430\u0434\u0438\u043a\u0430\u043b\u044c\u043d\u0430\u044f \u0432\u043e\u0435\u043d\u0438\u0437\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B9_%D1%88%D0%BB%D0%B5%D0%BC\" title=\"\u0421\u0442\u0430\u043b\u044c\u043d\u043e\u0439 \u0448\u043b\u0435\u043c\">\u0421\u0442\u0430\u043b\u044c\u043d\u043e\u0439 \u0448\u043b\u0435\u043c<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u041d\u0430\u0447\u0438\u043d\u0430\u044e\u0442\u0441\u044f \u0437\u0430\u043d\u044f\u0442\u0438\u044f \u043d\u0430 \u0420\u044f\u0437\u0430\u043d\u0441\u043a\u0438\u0445 \u043f\u0435\u0445\u043e\u0442\u043d\u044b\u0445 \u043a\u0443\u0440\u0441\u0430\u0445 \u043a\u043e\u043c\u0430\u043d\u0434\u043d\u043e\u0433\u043e \u0441\u043e\u0441\u0442\u0430\u0432\u0430 \u0420\u041a\u041a\u0410, \u043d\u0430 \u0431\u0430\u0437\u0435 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0441\u043e\u0437\u0434\u0430\u0441\u0442\u0441\u044f \u0441\u043d\u0430\u0447\u0430\u043b\u0430 \u043f\u0435\u0445\u043e\u0442\u043d\u043e\u0435, \u0430 \u0437\u0430\u0442\u0435\u043c \u0412\u043e\u0437\u0434\u0443\u0448\u043d\u043e-\u0434\u0435\u0441\u0430\u043d\u0442\u043d\u043e\u0435 \u0443\u0447\u0438\u043b\u0438\u0449\u0435 (\u043d\u044b\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%8F%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D1%8B%D1%81%D1%88%D0%B5%D0%B5_%D0%B2%D0%BE%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D0%BE-%D0%B4%D0%B5%D1%81%D0%B0%D0%BD%D1%82%D0%BD%D0%BE%D0%B5_%D0%BA%D0%BE%D0%BC%D0%B0%D0%BD%D0%B4%D0%BD%D0%BE%D0%B5_%D1%83%D1%87%D0%B8%D0%BB%D0%B8%D1%89%D0%B5\" title=\"\u0420\u044f\u0437\u0430\u043d\u0441\u043a\u043e\u0435 \u0432\u044b\u0441\u0448\u0435\u0435 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e-\u0434\u0435\u0441\u0430\u043d\u0442\u043d\u043e\u0435 \u043a\u043e\u043c\u0430\u043d\u0434\u043d\u043e\u0435 \u0443\u0447\u0438\u043b\u0438\u0449\u0435\">\u0420\u044f\u0437\u0430\u043d\u0441\u043a\u043e\u0435 \u0432\u044b\u0441\u0448\u0435\u0435 \u0412\u043e\u0437\u0434\u0443\u0448\u043d\u043e-\u0434\u0435\u0441\u0430\u043d\u0442\u043d\u043e\u0435 \u043a\u043e\u043c\u0430\u043d\u0434\u043d\u043e\u0435 \u0434\u0432\u0430\u0436\u0434\u044b \u041a\u0440\u0430\u0441\u043d\u043e\u0437\u043d\u0430\u043c\u0451\u043d\u043d\u043e\u0435 \u0443\u0447\u0438\u043b\u0438\u0449\u0435<\/a> \u0438\u043c\u0435\u043d\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B3%D0%B5%D0%BB%D0%BE%D0%B2,_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0430\u0440\u0433\u0435\u043b\u043e\u0432, \u0412\u0430\u0441\u0438\u043b\u0438\u0439 \u0424\u0438\u043b\u0438\u043f\u043f\u043e\u0432\u0438\u0447\">\u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0430 \u0430\u0440\u043c\u0438\u0438 \u0412.&#160;\u0424.&#160;\u041c\u0430\u0440\u0433\u0435\u043b\u043e\u0432\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u043e\u0439 \u043f\u044c\u0435\u0441\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%82%D0%B5%D1%80%D0%BB%D0%B8%D0%BD%D0%BA,_%D0%9C%D0%BE%D1%80%D0%B8%D1%81\" title=\"\u041c\u0435\u0442\u0435\u0440\u043b\u0438\u043d\u043a, \u041c\u043e\u0440\u0438\u0441\">\u041c. \u041c\u0435\u0442\u0435\u0440\u043b\u0438\u043d\u043a\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%85%D1%82%D0%B0%D0%BD%D0%B3%D0%BE%D0%B2,_%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D0%B8%D0%B9_%D0%91%D0%B0%D0%B3%D1%80%D0%B0%D1%82%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0412\u0430\u0445\u0442\u0430\u043d\u0433\u043e\u0432, \u0415\u0432\u0433\u0435\u043d\u0438\u0439 \u0411\u0430\u0433\u0440\u0430\u0442\u0438\u043e\u043d\u043e\u0432\u0438\u0447\">\u0415.&#160;\u0411.&#160;\u0412\u0430\u0445\u0442\u0430\u043d\u0433\u043e\u0432\u044b\u043c<\/a> \u0440\u043e\u0434\u0438\u043b\u0430\u0441\u044c \u0422\u0440\u0435\u0442\u044c\u044f \u0421\u0442\u0443\u0434\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%A5%D1%83%D0%B4%D0%BE%D0%B6%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0425\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0442\u0435\u0430\u0442\u0440\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0425\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0442\u0435\u0430\u0442\u0440\u0430<\/a>, \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438, \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4_%D0%B2_%D1%82%D0%B5%D0%B0%D1%82%D1%80%D0%B5\" title=\"1926 \u0433\u043e\u0434 \u0432 \u0442\u0435\u0430\u0442\u0440\u0435\">1926 \u0433\u043e\u0434\u0443<\/a>, \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u043d\u0430\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%B0%D0%BA%D0%B0%D0%B4%D0%B5%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%95._%D0%92%D0%B0%D1%85%D1%82%D0%B0%D0%BD%D0%B3%D0%BE%D0%B2%D0%B0\" class=\"mw-redirect\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440 \u0438\u043c\u0435\u043d\u0438 \u0415. \u0412\u0430\u0445\u0442\u0430\u043d\u0433\u043e\u0432\u0430\">\u0422\u0435\u0430\u0442\u0440 \u0438\u043c\u0435\u043d\u0438 \u0415\u0432\u0433\u0435\u043d\u0438\u044f \u0412\u0430\u0445\u0442\u0430\u043d\u0433\u043e\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u041f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u0444\u0438\u043b\u044c\u043c\u0430 \u00ab\u0428\u0435\u0439\u0445\u00bb \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BB%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%BE,_%D0%A0%D1%83%D0%B4%D0%BE%D0%BB%D1%8C%D1%84\" title=\"\u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u043e, \u0420\u0443\u0434\u043e\u043b\u044c\u0444\">\u0420\u0443\u0434\u043e\u043b\u044c\u0444\u043e\u043c \u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u043e<\/a> \u0432 \u0433\u043b\u0430\u0432\u043d\u043e\u0439 \u0440\u043e\u043b\u0438. \u0417\u0430 \u0430\u043a\u0442\u0451\u0440\u043e\u043c \u043e\u043a\u043e\u043d\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u0443\u043a\u0440\u0435\u043f\u043b\u044f\u0435\u0442\u0441\u044f \u0441\u043b\u0430\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BA%D1%81-%D1%81%D0%B8%D0%BC%D0%B2%D0%BE%D0%BB\" title=\"\u0421\u0435\u043a\u0441-\u0441\u0438\u043c\u0432\u043e\u043b\">\u0441\u0435\u043a\u0441-\u0441\u0438\u043c\u0432\u043e\u043b\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D0%BB%D0%B8%D0%B2%D1%83%D0%B4\" title=\"\u0413\u043e\u043b\u043b\u0438\u0432\u0443\u0434\">\u0413\u043e\u043b\u043b\u0438\u0432\u0443\u0434\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4\" title=\"1928 \u0433\u043e\u0434\">1928<\/a>&#160;\u2014 \u043d\u0430 \u0431\u0430\u0437\u0435 \u043b\u0430\u0431\u043e\u0440\u0430\u0442\u043e\u0440\u0438\u0438 \u043f\u043e \u0438\u0437\u0443\u0447\u0435\u043d\u0438\u044e \u043c\u043e\u0437\u0433\u0430 \u041b\u0435\u043d\u0438\u043d\u0430 \u043d\u0435\u043c\u0435\u0446\u043a\u043e\u0433\u043e \u0444\u0438\u0437\u0438\u043e\u043b\u043e\u0433\u0430 \u041e\u0441\u043a\u0430\u0440\u0430 \u0424\u043e\u0433\u0442\u0430 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 \u0441\u043e\u0437\u0434\u0430\u043d \u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u043c\u043e\u0437\u0433\u0430<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a>&#160;\u2014 \u0414\u043b\u044f \u043f\u0440\u0438\u0451\u043c\u0430 \u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0438\u0445 \u0440\u0435\u043f\u0430\u0440\u0430\u0446\u0438\u0439 \u0432 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u043f\u043b\u0430\u043d\u043e\u043c \u042f\u043d\u0433\u0430 \u0443\u0447\u0440\u0435\u0436\u0434\u0430\u0435\u0442\u0441\u044f \u0411\u0430\u0437\u0435\u043b\u044c\u0441\u043a\u0438\u0439 \u0431\u0430\u043d\u043a \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u0440\u0430\u0441\u0447\u0451\u0442\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1931_%D0%B3%D0%BE%D0%B4\" title=\"1931 \u0433\u043e\u0434\">1931<\/a>&#160;\u2014 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BB%D1%8C%D1%81%D1%82%D1%80%D0%BE%D0%B9\" title=\"\u0414\u0430\u043b\u044c\u0441\u0442\u0440\u043e\u0439\">\u0414\u0430\u043b\u044c\u0441\u0442\u0440\u043e\u0439<\/a>\u00bb&#160;\u2014 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0442\u0440\u0435\u0441\u0442 \u043f\u043e \u0434\u043e\u0440\u043e\u0436\u043d\u043e\u043c\u0443 \u0438 \u043f\u0440\u043e\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u043e\u043c\u0443 \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0443 \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 \u0412\u0435\u0440\u0445\u043d\u0435\u0439 \u041a\u043e\u043b\u044b\u043c\u044b (c 1938&#160;\u0433.&#160;\u2014 \u0413\u043b\u0430\u0432\u043d\u043e\u0435 \u0423\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u0414\u0430\u043b\u044c\u043d\u0435\u0433\u043e \u0421\u0435\u0432\u0435\u0440\u0430 \u041d\u041a\u0412\u0414 \u0421\u0421\u0421\u0420 \u00ab\u0414\u0430\u043b\u044c\u0441\u0442\u0440\u043e\u0439\u00bb), \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u0438\u0437\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 (\u0441\u0443\u043f\u0435\u0440\u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f, \u00ab\u043a\u043e\u043c\u0431\u0438\u043d\u0430\u0442 \u043e\u0441\u043e\u0431\u043e\u0433\u043e \u0442\u0438\u043f\u0430\u00bb), \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0432\u0448\u0438\u0439 \u0432 30\u201450 \u0433\u0433. XX \u0441\u0442\u043e\u043b\u0435\u0442\u0438\u044f \u043e\u0441\u0432\u043e\u0435\u043d\u0438\u0435 \u0421\u0435\u0432\u0435\u0440\u043e-\u0412\u043e\u0441\u0442\u043e\u043a\u0430 \u0421\u0421\u0421\u0420.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043e\u0441\u043d\u043e\u0432\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u043c\u0430\u0448\u0438\u043d\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0438\u043c\u0435\u043d\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BB%D0%B0%D0%B3%D0%BE%D0%BD%D1%80%D0%B0%D0%B2%D0%BE%D0%B2,_%D0%90%D0%BD%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D0%B9_%D0%90%D1%80%D0%BA%D0%B0%D0%B4%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0411\u043b\u0430\u0433\u043e\u043d\u0440\u0430\u0432\u043e\u0432, \u0410\u043d\u0430\u0442\u043e\u043b\u0438\u0439 \u0410\u0440\u043a\u0430\u0434\u044c\u0435\u0432\u0438\u0447\">\u0410.&#160;\u0410.&#160;\u0411\u043b\u0430\u0433\u043e\u043d\u0440\u0430\u0432\u043e\u0432\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D0%BA%D0%B0%D0%B4%D0%B5%D0%BC%D0%B8%D1%8F_%D0%BD%D0%B0%D1%83%D0%BA\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u043d\u0430\u0443\u043a\">\u0420\u0410\u041d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a>&#160;\u2014 \u041a\u043e\u043c\u043f\u0430\u043d\u0438\u044f Willis Motor Co. \u0438\u0441\u043f\u044b\u0442\u044b\u0432\u0430\u0435\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Jeep\" title=\"Jeep\">\u0434\u0436\u0438\u043f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a>&#160;\u2014 \u0413\u043b\u0430\u0432\u0430 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0434\u0435\u043b\u0435\u0433\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BB%D0%BE%D1%82%D0%BE%D0%B2,_%D0%92%D1%8F%D1%87%D0%B5%D1%81%D0%BB%D0%B0%D0%B2_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u043e\u043b\u043e\u0442\u043e\u0432, \u0412\u044f\u0447\u0435\u0441\u043b\u0430\u0432 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u0412\u044f\u0447\u0435\u0441\u043b\u0430\u0432 \u041c\u043e\u043b\u043e\u0442\u043e\u0432<\/a> \u0432\u0441\u0442\u0440\u0435\u0447\u0430\u0435\u0442\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d\u0435<\/a> \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D1%82%D0%BB%D0%B5%D1%80,_%D0%90%D0%B4%D0%BE%D0%BB%D1%8C%D1%84\" title=\"\u0413\u0438\u0442\u043b\u0435\u0440, \u0410\u0434\u043e\u043b\u044c\u0444\">\u0410\u0434\u043e\u043b\u044c\u0444\u043e\u043c \u0413\u0438\u0442\u043b\u0435\u0440\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 \u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D0%B8%D0%B0%D0%BD%D0%BE%D1%81%D0%B5%D1%86\" title=\"\u0410\u0432\u0438\u0430\u043d\u043e\u0441\u0435\u0446\">\u0430\u0432\u0438\u0430\u043d\u043e\u0441\u0435\u0446<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/HMS_Ark_Royal_(91)\" class=\"mw-redirect\" title=\"HMS Ark Royal (91)\">\u0410\u0440\u043a \u0420\u043e\u0439\u044f\u043b<\/a>\u00bb \u0430\u0442\u0430\u043a\u0443\u0435\u0442\u0441\u044f \u043d\u0435\u043c\u0435\u0446\u043a\u043e\u0439 \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u043e\u0439 \u043b\u043e\u0434\u043a\u043e\u0439 \u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%B1%D1%80%D0%B0%D0%BB%D1%82%D0%B0%D1%80\" title=\"\u0413\u0438\u0431\u0440\u0430\u043b\u0442\u0430\u0440\">\u0413\u0438\u0431\u0440\u0430\u043b\u0442\u0430\u0440\u0430<\/a>. \u041e\u043d \u0437\u0430\u0442\u043e\u043d\u0435\u0442 \u043d\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0439 \u0434\u0435\u043d\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 \u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0433\u043e\u043b\u043e\u0441\u0443\u0435\u0442 \u0437\u0430 \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u0435 \u043f\u043e\u043f\u0440\u0430\u0432\u043a\u0438 \u043a \u0417\u0430\u043a\u043e\u043d\u0443 \u043e \u043d\u0435\u0439\u0442\u0440\u0430\u043b\u0438\u0442\u0435\u0442\u0435, \u043f\u043e\u0437\u0432\u043e\u043b\u044f\u044e\u0449\u0443\u044e \u0432\u043e\u043e\u0440\u0443\u0436\u0430\u0442\u044c \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u0435 \u0441\u0443\u0434\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043c\u043e\u0433\u0443\u0442 \u043e\u043a\u0430\u0437\u0430\u0442\u044c\u0441\u044f \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 \u0431\u043e\u0435\u0432\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 \u0412 \u0421\u0435\u0432\u0435\u0440\u043e-\u0412\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0438\u0432\u0438\u044f\">\u041b\u0438\u0432\u0438\u0438<\/a> \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0441\u043d\u043e\u0432\u0430 \u043f\u043e \u043e\u0447\u0435\u0440\u0435\u0434\u0438 \u043e\u0432\u043b\u0430\u0434\u0435\u0432\u0430\u044e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%B1%D1%80%D1%83%D0%BA\" title=\"\u0422\u043e\u0431\u0440\u0443\u043a\">\u0422\u043e\u0431\u0440\u0443\u043a\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1943_%D0%B3%D0%BE%D0%B4\" title=\"1943 \u0433\u043e\u0434\">1943<\/a>&#160;\u2014 \u0417\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BD%D0%B0%D1%81%D1%82%D1%83%D0%BF%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u041a\u0438\u0435\u0432\u0441\u043a\u0430\u044f \u043d\u0430\u0441\u0442\u0443\u043f\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f\">\u041a\u0438\u0435\u0432\u0441\u043a