2\u043d\u0438\u0447\u044c\u044e \u0441 \u043b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u0438\u043c \u043a\u043b\u0443\u0431\u043e\u043c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D0%BB%D1%81%D0%B8_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1)\" title=\"\u0427\u0435\u043b\u0441\u0438 (\u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0439 \u043a\u043b\u0443\u0431)\">\u0427\u0435\u043b\u0441\u0438<\/a>\u00bb&#160;\u2014 3:3. \u041f\u0435\u0440\u0432\u044b\u0439 \u0433\u043e\u043b \u0432 \u0432\u043e\u0440\u043e\u0442\u0430 \u0445\u043e\u0437\u044f\u0435\u0432 \u043f\u043e\u043b\u044f \u0437\u0430\u0431\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D1%86%D0%B5%D0%B2,_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0430\u0440\u0446\u0435\u0432, \u0412\u0430\u0441\u0438\u043b\u0438\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u0412\u0430\u0441\u0438\u043b\u0438\u0439 \u041a\u0430\u0440\u0446\u0435\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a>&#160;\u2014 \u0412\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5_%D0%93%D0%BE%D0%BB%D0%BB%D1%8C,_%D0%A8%D0%B0%D1%80%D0%BB%D1%8C\" title=\"\u0414\u0435 \u0413\u043e\u043b\u043b\u044c, \u0428\u0430\u0440\u043b\u044c\">\u0428\u0430\u0440\u043b\u044c \u0434\u0435 \u0413\u043e\u043b\u043b\u044c<\/a> \u0438\u0437\u0431\u0438\u0440\u0430\u0435\u0442\u0441\u044f \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u0435\u043c \u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 \u041e\u043a\u043e\u043b\u043e 03:00. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B1%D0%B5%D0%BA\" class=\"mw-redirect\" title=\"\u041b\u0435\u0431\u0435\u043a\">\u041b\u0435\u0431\u0435\u043a<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F\" title=\"\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u044f\">\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>. \u0421\u0430\u043c\u043e\u043b\u0451\u0442 Douglas C-53D-DO \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 Western Air Lines \u0432 \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u0445 \u0434\u043e\u0436\u0434\u044f \u0438 \u0432\u0435\u0442\u0440\u0430 \u0441 \u043f\u043e\u0440\u044b\u0432\u0430\u043c\u0438 \u0434\u043e 70 \u043c\u0438\u043b\u044c \u0432 \u0447\u0430\u0441 \u0441\u0431\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0441 \u043a\u0443\u0440\u0441\u0430 \u0438 \u0432\u0440\u0435\u0437\u0430\u0435\u0442\u0441\u044f \u0432 \u0433\u043e\u0440\u0443 \u0423\u0430\u0439\u0442. \u0412\u0441\u0435 11 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442. \u0421\u0430\u043c\u043e\u043b\u0451\u0442 \u043b\u0435\u0442\u0435\u043b \u0432 \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0438 \u0438\u0437 \u041f\u0430\u043b\u043c\u0434\u0435\u0439\u043b \u0432 \u041d\u044c\u044e\u0445\u043e\u043b\u043b. \u0412\u043e\u0437\u043c\u043e\u0436\u043d\u043e, \u043d\u0438\u0441\u0445\u043e\u0434\u044f\u0449\u0438\u0439 \u043f\u043e\u0442\u043e\u043a \u0432\u043e\u0437\u0434\u0443\u0445\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 \u0433\u043e\u0434\">1947<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0430\u043d\u0438\u044f\">\u0414\u0430\u043d\u0438\u0438<\/a> \u0441\u043e\u0446\u0438\u0430\u043b-\u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u044b \u0444\u043e\u0440\u043c\u0438\u0440\u0443\u044e\u0442 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043c\u0435\u043d\u044c\u0448\u0438\u043d\u0441\u0442\u0432\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 \u041e\u043a\u043e\u043b\u043e 18:00, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a>. \u0412\u044b\u043f\u043e\u043b\u043d\u044f\u044f \u0440\u0435\u0439\u0441 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC\" title=\"\u0420\u0438\u043c\">\u0420\u0438\u043c\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u044f<\/a>) \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%80%D0%B5%D0%B0%D0%BB%D1%8C\" title=\"\u041c\u043e\u043d\u0440\u0435\u0430\u043b\u044c\">\u041c\u043e\u043d\u0440\u0435\u0430\u043b\u044c<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0430<\/a>), \u0441\u0430\u043c\u043e\u043b\u0451\u0442 Douglas DC-4 \u043a\u0430\u043d\u0430\u0434\u0441\u043a\u043e\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 Curtiss-Reid Flying Services Ltd. \u043e\u0442\u043a\u043b\u043e\u043d\u044f\u0435\u0442\u0441\u044f \u043d\u0430 50 \u043c\u0438\u043b\u044c \u043e\u0442 \u043f\u0440\u0435\u0434\u043f\u0438\u0441\u0430\u043d\u043d\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0430 \u0438 \u0432\u0440\u0435\u0437\u0430\u0435\u0442\u0441\u044f \u0432 \u0433\u043e\u0440\u0443 \u041b\u2019\u041e\u0431\u0438\u0443. \u0412\u0441\u0435 58 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442. \u041f\u0438\u043b\u043e\u0442 \u0441\u043a\u043e\u0440\u0435\u0435 \u0432\u0441\u0435\u0433\u043e \u0437\u043d\u0430\u043b \u043e\u0431 \u043e\u0442\u043a\u043b\u043e\u043d\u0435\u043d\u0438\u0438 \u043e\u0442 \u043a\u0443\u0440\u0441\u0430 \u0438 \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u043d\u0438\u043c\u0430\u043b \u043c\u0435\u0440\u044b, \u0447\u0442\u043e\u0431\u044b \u044d\u0442\u043e \u0441\u043a\u043e\u0440\u0440\u0435\u043a\u0442\u0438\u0440\u043e\u0432\u0430\u0442\u044c, \u043d\u043e \u0432\u043e\u0432\u0440\u0435\u043c\u044f \u043d\u0435 \u0437\u0430\u043c\u0435\u0442\u0438\u043b \u0433\u043e\u0440\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1953_%D0%B3%D0%BE%D0%B4\" title=\"1953 \u0433\u043e\u0434\">1953<\/a>&#160;\u2014 \u041f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 4-\u0433\u043e \u0441\u0442\u0440\u0443\u043d\u043d\u043e\u0433\u043e \u043a\u0432\u0430\u0440\u0442\u0435\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BE%D1%81%D1%82%D0%B0%D0%BA%D0%BE%D0%B2%D0%B8%D1%87,_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B9_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0428\u043e\u0441\u0442\u0430\u043a\u043e\u0432\u0438\u0447, \u0414\u043c\u0438\u0442\u0440\u0438\u0439 \u0414\u043c\u0438\u0442\u0440\u0438\u0435\u0432\u0438\u0447\">\u0414\u043c\u0438\u0442\u0440\u0438\u044f \u0428\u043e\u0441\u0442\u0430\u043a\u043e\u0432\u0438\u0447\u0430<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1954_%D0%B3%D0%BE%D0%B4\" title=\"1954 \u0433\u043e\u0434\">1954<\/a>&#160;\u2014 \u041d\u043e\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> 23 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430\u043c \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043e \u0441\u043e\u0437\u044b\u0432\u0435 \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0438 \u043f\u043e \u0432\u043e\u043f\u0440\u043e\u0441\u0430\u043c \u043a\u043e\u043b\u043b\u0435\u043a\u0442\u0438\u0432\u043d\u043e\u0439 \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B0\" title=\"\u0415\u0432\u0440\u043e\u043f\u0430\">\u0415\u0432\u0440\u043e\u043f\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1954_%D0%B3%D0%BE%D0%B4\" title=\"1954 \u0433\u043e\u0434\">1954<\/a>&#160;\u2014 \u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0440\u044f \u0443\u0441\u043f\u0435\u0445\u0443 \u041f\u0430\u0440\u0442\u0438\u0438 \u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043a\u0440\u0435\u0434\u0438\u0442\u0430 \u043d\u0430 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%97%D0%B5%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u041d\u043e\u0432\u0430\u044f \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u044f\">\u041d\u043e\u0432\u043e\u0439 \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u0438<\/a> \u0431\u043e\u043b\u044c\u0448\u0438\u043d\u0441\u0442\u0432\u043e, \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u0440\u0430\u0441\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442 \u043f\u0440\u0430\u0432\u044f\u0449\u0430\u044f \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0432 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0435, \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0443\u043c\u0435\u043d\u044c\u0448\u0430\u0435\u0442\u0441\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1956_%D0%B3%D0%BE%D0%B4\" title=\"1956 \u0433\u043e\u0434\">1956<\/a>&#160;\u2014 \u0411\u043e\u0439\u043a\u043e\u0442 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0438\u0445 \u0430\u0432\u0442\u043e\u0431\u0443\u0441\u043e\u0432 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%82%D0%B3%D0%BE%D0%BC%D0%B5%D1%80%D0%B8_(%D0%90%D0%BB%D0%B0%D0%B1%D0%B0%D0%BC%D0%B0)\" title=\"\u041c\u043e\u043d\u0442\u0433\u043e\u043c\u0435\u0440\u0438 (\u0410\u043b\u0430\u0431\u0430\u043c\u0430)\">\u041c\u043e\u043d\u0442\u0433\u043e\u043c\u0435\u0440\u0438<\/a>, \u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B0%D0%B1%D0%B0%D0%BC%D0%B0_(%D1%88%D1%82%D0%B0%D1%82)\" class=\"mw-redirect\" title=\"\u0410\u043b\u0430\u0431\u0430\u043c\u0430 (\u0448\u0442\u0430\u0442)\">\u0410\u043b\u0430\u0431\u0430\u043c\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>, \u043f\u0440\u0435\u043a\u0440\u0430\u0449\u0430\u0435\u0442\u0441\u044f \u043f\u043e\u0441\u043b\u0435 \u0442\u043e\u0433\u043e, \u043a\u0430\u043a \u0412\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u0439 \u0441\u0443\u0434 \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442 \u0430\u043d\u0442\u0438\u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u043e\u043d\u043d\u043e\u0439 \u0441\u0435\u0433\u0440\u0435\u0433\u0430\u0446\u0438\u044e \u0432 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u0438\u0445 \u0430\u0432\u0442\u043e\u0431\u0443\u0441\u0430\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1959_%D0%B3%D0%BE%D0%B4\" title=\"1959 \u0433\u043e\u0434\">1959<\/a>&#160;\u2014 \u041d\u0430 \u0441\u044a\u0435\u0437\u0434\u0435 \u0432 \u0419\u043e\u0445\u0430\u043d\u043d\u0435\u0441\u0431\u0443\u0440\u0433\u0435, \u042e\u0436\u043d\u0430\u044f \u0410\u0444\u0440\u0438\u043a\u0430, \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u041f\u0440\u043e\u0433\u0440\u0435\u0441\u0441\u0438\u0432\u043d\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438 \u042e\u0436\u043d\u043e\u0439 \u0410\u0444\u0440\u0438\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1960_%D0%B3%D0%BE%D0%B4\" title=\"1960 \u0433\u043e\u0434\">1960<\/a>&#160;\u2014 \u041d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u043e\u0435 \u0430\u043d\u0442\u0438\u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B2%D0%B0%D1%82%D0%B5%D0%BC%D0%B0%D0%BB%D0%B0\" title=\"\u0413\u0432\u0430\u0442\u0435\u043c\u0430\u043b\u0430\">\u0413\u0432\u0430\u0442\u0435\u043c\u0430\u043b\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 \u0418\u0437\u0440\u0430\u0438\u043b\u044c\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0430\u0442\u0430\u043a\u0443\u044e\u0442 \u0438\u043e\u0440\u0434\u0430\u043d\u0441\u043a\u0438\u0435 \u043f\u043e\u0437\u0438\u0446\u0438\u0438 \u0432\u0431\u043b\u0438\u0437\u0438 \u0425\u0435\u0432\u0440\u043e\u043d\u0430 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/25_%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8F\" title=\"25 \u043d\u043e\u044f\u0431\u0440\u044f\">25 \u043d\u043e\u044f\u0431\u0440\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%9E%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u041d\u0430\u0446\u0438\u0439\">\u041e\u041e\u041d<\/a> \u0432\u044b\u0441\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u0441\u0432\u043e\u0451 \u043e\u0441\u0443\u0436\u0434\u0435\u043d\u0438\u0435 \u044d\u0442\u043e\u0439 \u0430\u043a\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C\" title=\"\u0418\u0437\u0440\u0430\u0438\u043b\u044c\">\u0418\u0437\u0440\u0430\u0438\u043b\u044f<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 \u0412 \u043c\u043e\u0440\u0435 \u0443 \u041c\u0430\u0442\u0441\u0443\u044f\u043c\u0430, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u044f<\/a>, \u0441\u0430\u043c\u043e\u043b\u0451\u0442 NAMC-YS-11-111 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 All Nippon Airways \u0440\u0430\u0437\u0431\u0438\u0432\u0430\u0435\u0442\u0441\u044f, \u043f\u0440\u0438\u0437\u0435\u043c\u043b\u0438\u0432\u0448\u0438\u0441\u044c \u0441\u043b\u0438\u0448\u043a\u043e\u043c \u0434\u0430\u043b\u0435\u043a\u043e \u043e\u0442 \u043d\u0430\u0447\u0430\u043b\u0430 \u043f\u043e\u043b\u043e\u0441\u044b. \u0412\u0441\u0435 50 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u041f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u043c\u0443\u043b\u044c\u0442\u0444\u0438\u043b\u044c\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D1%91%D0%BB%D1%82%D0%B0%D1%8F_%D0%BF%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B0_(%D0%BC%D1%83%D0%BB%D1%8C%D1%82%D1%84%D0%B8%D0%BB%D1%8C%D0%BC)\" title=\"\u0416\u0451\u043b\u0442\u0430\u044f \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430 (\u043c\u0443\u043b\u044c\u0442\u0444\u0438\u043b\u044c\u043c)\">\u00abYellow Submarine\u00bb (\u0416\u0451\u043b\u0442\u0430\u044f \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430)<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1970_%D0%B3%D0%BE%D0%B4\" title=\"1970 \u0433\u043e\u0434\">1970<\/a>&#160;\u2014 \u0426\u0438\u043a\u043b\u043e\u043d \u0438 \u043f\u0440\u0438\u043b\u0438\u0432\u043d\u044b\u0435 \u0432\u043e\u043b\u043d\u044b, \u043d\u0430\u0445\u043b\u044b\u043d\u0443\u0432\u0448\u0438\u0435 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BD%D0%B3%D0%BB%D0%B0%D0%B4%D0%B5%D1%88\" title=\"\u0411\u0430\u043d\u0433\u043b\u0430\u0434\u0435\u0448\">\u0411\u0430\u043d\u0433\u043b\u0430\u0434\u0435\u0448<\/a>, \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0430\u044e\u0442 \u0441\u0432\u044b\u0448\u0435 500,000 \u043b\u044e\u0434\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1971_%D0%B3%D0%BE%D0%B4\" title=\"1971 \u0433\u043e\u0434\">1971<\/a>&#160;\u2014 \u0421\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u0432\u044b\u0432\u043e\u0434 \u043d\u0430 \u043e\u0440\u0431\u0438\u0442\u0443 \u0432\u043e\u043a\u0440\u0443\u0433 \u041c\u0430\u0440\u0441\u0430 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u043c\u0435\u0436\u043f\u043b\u0430\u043d\u0435\u0442\u043d\u043e\u0433\u043e \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0430\u043f\u043f\u0430\u0440\u0430\u0442\u0430; \u043f\u0435\u0440\u0432\u044b\u0439 \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0441\u043f\u0443\u0442\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D1%81_(%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" class=\"mw-redirect\" title=\"\u041c\u0430\u0440\u0441 (\u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u041c\u0430\u0440\u0441\u0430<\/a> (\u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B8%D0%BD%D0%B5%D1%80-9\" title=\"\u041c\u0430\u0440\u0438\u043d\u0435\u0440-9\">\u041c\u0430\u0440\u0438\u043d\u0435\u0440-9<\/a>\u00bb, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1973_%D0%B3%D0%BE%D0%B4\" title=\"1973 \u0433\u043e\u0434\">1973<\/a>&#160;\u2014 \u041f\u043e\u0434 \u0443\u0433\u0440\u043e\u0437\u043e\u0439 \u044d\u043d\u0435\u0440\u0433\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043a\u0440\u0438\u0437\u0438\u0441\u0430 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0432\u0432\u043e\u0434\u0438\u0442 \u0447\u0440\u0435\u0437\u0432\u044b\u0447\u0430\u0439\u043d\u043e\u0435 \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1973_%D0%B3%D0%BE%D0%B4\" title=\"1973 \u0433\u043e\u0434\">1973<\/a>&#160;\u2014 \u041f\u043e\u0441\u043b\u0435 \u0440\u0435\u043a\u043e\u0440\u0434\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BB%D1%8C%D0%B4%D0%BE\" title=\"\u0421\u0430\u043b\u044c\u0434\u043e\">\u0441\u0430\u043b\u044c\u0434\u043e<\/a> \u043f\u043b\u0430\u0442\u0451\u0436\u043d\u043e\u0433\u043e \u0431\u0430\u043b\u0430\u043d\u0441\u0430 \u043c\u0438\u043d\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0441\u0441\u0443\u0434\u043d\u0430\u044f \u0441\u0442\u0430\u0432\u043a\u0430 \u0432 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438 \u0443\u0432\u0435\u043b\u0438\u0447\u0435\u043d\u0430 \u0434\u043e 13&#160;%.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1974\" class=\"mw-redirect\" title=\"1974\">1974<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043f\u0440\u0438 \u0442\u0430\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u043e\u0431\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430\u0445 \u0443\u043c\u0438\u0440\u0430\u0435\u0442 \u041a\u0430\u0440\u044d\u043d \u0421\u0438\u043b\u043a\u0432\u0443\u0434, \u043d\u0435\u0437\u0430\u0434\u043e\u043b\u0433\u043e \u0434\u043e \u044d\u0442\u043e\u0433\u043e \u0432\u044b\u0440\u0430\u0437\u0438\u0432\u0448\u0430\u044f \u043e\u0437\u0430\u0431\u043e\u0447\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u0432 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0438 \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u044f\u0434\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u044f\u0442\u0438\u0439 \u041a\u0435\u0440\u0440-\u041c\u0430\u043a\u0433\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BA%D0%BB%D0%B0%D1%85%D0%BE%D0%BC%D0%B0\" title=\"\u041e\u043a\u043b\u0430\u0445\u043e\u043c\u0430\">\u041e\u043a\u043b\u0430\u0445\u043e\u043c\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1974\" class=\"mw-redirect\" title=\"1974\">1974<\/a>&#160;\u2014 \u041b\u0438\u0434\u0435\u0440 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BB%D0%B5%D1%81%D1%82%D0%B8%D0%BD%D0%B0\" title=\"\u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0430\">\u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D1%81%D0%B8%D1%80_%D0%90%D1%80%D0%B0%D1%84%D0%B0%D1%82\" class=\"mw-redirect\" title=\"\u042f\u0441\u0438\u0440 \u0410\u0440\u0430\u0444\u0430\u0442\">\u042f\u0441\u0438\u0440 \u0410\u0440\u0430\u0444\u0430\u0442<\/a> \u043e\u0431\u0440\u0430\u0449\u0430\u0435\u0442\u0441\u044f \u0441 \u043f\u043e\u0441\u043b\u0430\u043d\u0438\u0435\u043c \u043a \u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0410\u0441\u0441\u0430\u043c\u0431\u043b\u0435\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%9E%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u041d\u0430\u0446\u0438\u0439\">\u041e\u041e\u041d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1978_%D0%B3%D0%BE%D0%B4\" title=\"1978 \u0433\u043e\u0434\">1978<\/a>&#160;\u2014 \u0417\u0430\u043f\u0443\u0441\u043a \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u044b\u0441\u043e\u043a\u043e\u044d\u043d\u0435\u0440\u0433\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043e\u0431\u0441\u0435\u0440\u0432\u0430\u0442\u043e\u0440\u0438\u0438 \u00ab\u0425\u042d\u0410\u041e-2\u00bb, \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0430\u0442 \u0440\u0435\u043d\u0442\u0433\u0435\u043d\u043e\u0432\u0441\u043a\u043e\u0435 \u0438\u0437\u043b\u0443\u0447\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B2%D0%B0%D0%B7%D0%B0%D1%80\" title=\"\u041a\u0432\u0430\u0437\u0430\u0440\">\u043a\u0432\u0430\u0437\u0430\u0440\u0430<\/a>, \u0443\u0434\u0430\u043b\u0451\u043d\u043d\u043e\u0433\u043e \u043e\u0442 \u0417\u0435\u043c\u043b\u0438 \u043d\u0430 \u0440\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0438 10 000 000 000 \u0441\u0432\u0435\u0442\u043e\u0432\u044b\u0445 \u043b\u0435\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979_%D0%B3%D0%BE%D0%B4\" title=\"1979 \u0433\u043e\u0434\">1979<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D0%B3%D0%B0%D0%BD,_%D0%A0%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%B4\" title=\"\u0420\u0435\u0439\u0433\u0430\u043d, \u0420\u043e\u043d\u0430\u043b\u044c\u0434\">\u0420\u043e\u043d\u0430\u043b\u044c\u0434 \u0420\u0435\u0439\u0433\u0430\u043d<\/a>, \u0431\u044b\u0432\u0448\u0438\u0439 \u0433\u0443\u0431\u0435\u0440\u043d\u0430\u0442\u043e\u0440 \u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u0438, \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442 \u043e \u0441\u0432\u043e\u0451\u043c \u0440\u0435\u0448\u0435\u043d\u0438\u0438 \u043d\u0430\u0447\u0430\u0442\u044c \u0431\u043e\u0440\u044c\u0431\u0443 \u0437\u0430 \u043f\u0440\u0430\u0432\u043e \u0441\u0442\u0430\u0442\u044c \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u043e\u043c \u043e\u0442 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438 \u043d\u0430 \u043f\u0440\u0435\u0434\u0441\u0442\u043e\u044f\u0449\u0438\u0445 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979_%D0%B3%D0%BE%D0%B4\" title=\"1979 \u0433\u043e\u0434\">1979<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u043f\u043e\u0441\u043b\u0435 \u0433\u043e\u0434\u0438\u0447\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0435\u0440\u044b\u0432\u0430 \u0432\u043e\u0437\u043e\u0431\u043d\u043e\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0432\u044b\u0445\u043e\u0434 \u0433\u0430\u0437\u0435\u0442 \u00ab\u0422\u0430\u0439\u043c\u0441\u00bb, \u00ab\u0421\u0430\u043d\u0434\u0438 \u0442\u0430\u0439\u043c\u0441\u00bb \u0438 \u0432\u0441\u0435\u0445 \u043f\u0440\u0438\u043b\u043e\u0436\u0435\u043d\u0438\u0439 \u043a \u0433\u0430\u0437\u0435\u0442\u0435 \u00ab\u0422\u0430\u0439\u043c\u0441\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1980_%D0%B3%D0%BE%D0%B4\" title=\"1980 \u0433\u043e\u0434\">1980<\/a>&#160;\u2014 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0430\u043f\u043f\u0430\u0440\u0430\u0442 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%8F%D0%B4%D0%B6%D0%B5%D1%80-1\" title=\"\u0412\u043e\u044f\u0434\u0436\u0435\u0440-1\">\u0412\u043e\u044f\u0434\u0436\u0435\u0440-1<\/a>\u00bb \u043f\u0435\u0440\u0435\u0434\u0430\u043b \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BC%D0%BB%D1%8F\" title=\"\u0417\u0435\u043c\u043b\u044f\">\u0417\u0435\u043c\u043b\u044e<\/a> \u043f\u0435\u0440\u0432\u044b\u0435 \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%82%D1%83%D1%80%D0%BD_(%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" class=\"mw-redirect\" title=\"\u0421\u0430\u0442\u0443\u0440\u043d (\u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u0421\u0430\u0442\u0443\u0440\u043d\u0430<\/a> \u043a\u0440\u0443\u043f\u043d\u044b\u043c \u043f\u043b\u0430\u043d\u043e\u043c<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1985_%D0%B3%D0%BE%D0%B4\" title=\"1985 \u0433\u043e\u0434\">1985<\/a>&#160;\u2014 \u0418\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435 \u043a\u043e\u043b\u0443\u043c\u0431\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0432\u0443\u043b\u043a\u0430\u043d\u0430 \u041d\u0435\u0432\u0430\u0434\u043e-\u0434\u0435\u043b\u044c-\u0420\u0443\u0438\u0441 (Nevado del Ruiz), \u0431\u0435\u0437\u0434\u0435\u0439\u0441\u0442\u0432\u043e\u0432\u0430\u0432\u0448\u0435\u0433\u043e \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1845_%D0%B3%D0%BE%D0%B4\" title=\"1845 \u0433\u043e\u0434\">1845<\/a> \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0430\u0435\u0442 \u0441\u0432\u044b\u0448\u0435 20,000 \u043b\u044e\u0434\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1986_%D0%B3%D0%BE%D0%B4\" title=\"1986 \u0433\u043e\u0434\">1986<\/a>&#160;\u2014 \u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D0%B3%D0%B0%D0%BD,_%D0%A0%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%B4\" title=\"\u0420\u0435\u0439\u0433\u0430\u043d, \u0420\u043e\u043d\u0430\u043b\u044c\u0434\">\u0420\u0435\u0439\u0433\u0430\u043d<\/a> \u0434\u043e\u043f\u0443\u0441\u043a\u0430\u0435\u0442 \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u0441\u0435\u043a\u0440\u0435\u0442\u043d\u043e\u0433\u043e \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u044f \u043e \u043f\u043e\u0441\u0442\u0430\u0432\u043a\u0430\u0445 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043e\u0440\u0443\u0436\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BD\" title=\"\u0418\u0440\u0430\u043d\">\u0418\u0440\u0430\u043d<\/a>, \u043d\u043e \u043e\u0442\u0440\u0438\u0446\u0430\u0435\u0442 \u0435\u0451 \u0441\u0432\u044f\u0437\u044c \u0441 \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0435\u043d\u0438\u0435\u043c \u0437\u0430\u043b\u043e\u0436\u043d\u0438\u043a\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1987_%D0%B3%D0%BE%D0%B4\" title=\"1987 \u0433\u043e\u0434\">1987<\/a>&#160;\u2014 \u041e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u044b \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044b \u043e \u043f\u043b\u0435\u043d\u0443\u043c\u0435 \u041c\u0413\u041a \u043f\u0430\u0440\u0442\u0438\u0438 \u043f\u043e\u0434 \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u043e\u043c \u00ab\u042d\u043d\u0435\u0440\u0433\u0438\u0447\u043d\u043e \u0432\u0435\u0441\u0442\u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0443\u00bb. \u0412\u044b\u0434\u0435\u043b\u0435\u043d\u044b \u0441\u043b\u043e\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%B1%D0%B0%D1%87%D1%91%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432\u0430<\/a>: \u00ab\u0422\u043e\u0432\u0430\u0440\u0438\u0449 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D1%8C%D1%86%D0%B8%D0%BD,_%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0415\u043b\u044c\u0446\u0438\u043d, \u0411\u043e\u0440\u0438\u0441 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u0415\u043b\u044c\u0446\u0438\u043d<\/a> \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u043b \u043b\u0438\u0447\u043d\u044b\u0435 \u0430\u043c\u0431\u0438\u0446\u0438\u0438 \u0432\u044b\u0448\u0435 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043e\u0432 \u043f\u0430\u0440\u0442\u0438\u0438\u2026\u00bb<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1987_%D0%B3%D0%BE%D0%B4\" title=\"1987 \u0433\u043e\u0434\">1987<\/a>&#160;\u2014 \u0421 \u0442\u0435\u043c, \u0447\u0442\u043e\u0431\u044b \u0441\u043f\u043e\u0441\u043e\u0431\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c \u00ab\u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u043c\u0443 \u0441\u0435\u043a\u0441\u0443\u00bb, \u0438\u043b\u0438 \u043f\u0440\u0435\u0434\u043e\u0442\u0432\u0440\u0430\u0442\u0438\u0442\u044c \u0421\u041f\u0418\u0414, BBC \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0438\u0440\u0443\u0435\u0442 \u043d\u0430 \u044d\u043a\u0440\u0430\u043d\u0430\u0445 \u0411\u0440\u0438\u0442\u0430\u043d\u0438\u0438 \u043f\u0435\u0440\u0432\u044b\u0439 \u043a\u043e\u043c\u043c\u0435\u0440\u0447\u0435\u0441\u043a\u0438\u0439 \u043f\u0440\u0435\u0437\u0435\u0440\u0432\u0430\u0442\u0438\u0432 (\u0431\u0435\u0437 \u0438\u043c\u0435\u043d\u0438 \u043c\u0430\u0440\u043a\u0438).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989_%D0%B3%D0%BE%D0%B4\" title=\"1989 \u0433\u043e\u0434\">1989<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%B4%D1%80%D0%BE%D0%B2,_%D0%A5%D0%B0%D0%BD%D1%81\" title=\"\u041c\u043e\u0434\u0440\u043e\u0432, \u0425\u0430\u043d\u0441\">\u0413\u0430\u043d\u0441 \u041c\u043e\u0434\u0440\u043e\u0432<\/a> \u0438\u0437\u0431\u0438\u0440\u0430\u0435\u0442\u0441\u044f \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u0435\u043c \u0421\u043e\u0432\u0435\u0442\u0430 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%94%D0%A0\" class=\"mw-redirect\" title=\"\u0413\u0414\u0420\">\u0413\u0414\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989_%D0%B3%D0%BE%D0%B4\" title=\"1989 \u0433\u043e\u0434\">1989<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0441\u0443\u0434\u0430 \u043f\u0440\u0438\u0441\u044f\u0436\u043d\u044b\u0445 \u043f\u0440\u0438 \u0441\u043b\u0443\u0448\u0430\u043d\u0438\u0438 \u0434\u0435\u043b \u043e \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f\u0445, \u0437\u0430 \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043f\u0440\u0435\u0434\u0443\u0441\u043c\u043e\u0442\u0440\u0435\u043d\u0430 \u0441\u043c\u0435\u0440\u0442\u043d\u0430\u044f \u043a\u0430\u0437\u043d\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991_%D0%B3%D0%BE%D0%B4\" title=\"1991 \u0433\u043e\u0434\">1991<\/a>&#160;\u2014 \u041f\u043e\u0434 \u043d\u0430\u0431\u043b\u044e\u0434\u0435\u043d\u0438\u0435\u043c \u043a\u043e\u043c\u0438\u0441\u0441\u0438\u0438 \u043f\u043e \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044e \u043d\u0430\u0434 \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435\u043c \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u044f \u043e \u043f\u0440\u0435\u043a\u0440\u0430\u0449\u0435\u043d\u0438\u0438 \u043e\u0433\u043d\u044f \u0441\u043e\u0442\u043d\u0438 \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0438\u0445 \u043b\u0438\u0446 \u044d\u0432\u0430\u043a\u0443\u0438\u0440\u0443\u044e\u0442\u0441\u044f \u0438\u0437 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%83%D0%B1%D1%80%D0%BE%D0%B2%D0%BD%D0%B8%D0%BA\" title=\"\u0414\u0443\u0431\u0440\u043e\u0432\u043d\u0438\u043a\">\u0414\u0443\u0431\u0440\u043e\u0432\u043d\u0438\u043a<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D1%80%D0%B2%D0%B0%D1%82%D0%B8%D1%8F\" title=\"\u0425\u043e\u0440\u0432\u0430\u0442\u0438\u044f\">\u0425\u043e\u0440\u0432\u0430\u0442\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1992_%D0%B3%D0%BE%D0%B4\" title=\"1992 \u0433\u043e\u0434\">1992<\/a>&#160;\u2014 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0431\u043e\u043a\u0441\u0451\u0440 \u0420\u0438\u0434\u0434\u0438\u043a \u0411\u043e\u0443\u0438 \u0437\u0430\u0432\u043e\u0451\u0432\u044b\u0432\u0430\u0435\u0442 \u0437\u0432\u0430\u043d\u0438\u0435 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430 \u043c\u0438\u0440\u0430 \u0441\u0440\u0435\u0434\u0438 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u043e\u0432 \u0432 \u0442\u044f\u0436\u0451\u043b\u043e\u043c \u0432\u0435\u0441\u0435, \u0432\u044b\u0438\u0433\u0440\u0430\u0432 \u043f\u043e \u043e\u0447\u043a\u0430\u043c \u0443 \u042d\u0432\u0430\u043d\u0434\u0435\u0440\u0430 \u0425\u043e\u043b\u0438\u0444\u0438\u043b\u0434\u0430. \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%81-%D0%92%D0%B5%D0%B3%D0%B0%D1%81_(%D0%9D%D0%B5%D0%B2%D0%B0%D0%B4%D0%B0)\" class=\"mw-redirect\" title=\"\u041b\u0430\u0441-\u0412\u0435\u0433\u0430\u0441 (\u041d\u0435\u0432\u0430\u0434\u0430)\">\u041b\u0430\u0441-\u0412\u0435\u0433\u0430\u0441\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1993_%D0%B3%D0%BE%D0%B4\" title=\"1993 \u0433\u043e\u0434\">1993<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_MD-82_%D0%BF%D0%BE%D0%B4_%D0%A3%D1%80%D1%83%D0%BC%D1%87%D0%B8\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 MD-82 \u043f\u043e\u0434 \u0423\u0440\u0443\u043c\u0447\u0438\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 MD-82 \u043f\u043e\u0434 \u0423\u0440\u0443\u043c\u0447\u0438<\/a>. \u0418\u0437 102 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442 12. \u0410\u0432\u0442\u043e\u043f\u0438\u043b\u043e\u0442 \u0431\u044b\u043b \u043d\u0435 \u0441\u043e\u0433\u043b\u0430\u0441\u043e\u0432\u0430\u043d \u0441 \u0443\u043a\u0430\u0437\u0430\u0442\u0435\u043b\u0435\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994_%D0%B3%D0%BE%D0%B4\" title=\"1994 \u0433\u043e\u0434\">1994<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0446\u0438\u044f<\/a> \u0432\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7\" title=\"\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0439 \u0441\u043e\u044e\u0437\">\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0439 \u0441\u043e\u044e\u0437<\/a> \u0447\u0435\u0440\u0435\u0437 \u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B4%D1%80%D1%83%D0%B6%D0%B5%D1%81%D1%82%D0%B2%D0%BE_%D0%BD%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u0421\u043e\u0434\u0440\u0443\u0436\u0435\u0441\u0442\u0432\u043e \u043d\u0430\u0446\u0438\u0439\">\u0421\u043e\u0434\u0440\u0443\u0436\u0435\u0441\u0442\u0432\u043e<\/a> \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u0442 \u0432 \u0441\u0432\u043e\u0438 \u0440\u044f\u0434\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%B7%D0%B0%D0%BC%D0%B1%D0%B8%D0%BA\" title=\"\u041c\u043e\u0437\u0430\u043c\u0431\u0438\u043a\">\u041c\u043e\u0437\u0430\u043c\u0431\u0438\u043a<\/a>, \u0431\u044b\u0432\u0448\u0443\u044e \u043f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u044c\u0441\u043a\u0443\u044e \u043a\u043e\u043b\u043e\u043d\u0438\u044e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 \u0412 \u0445\u043e\u0434\u0435 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u0430 \u0438 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BB%D0%B8%D0%BD%D1%82%D0%BE%D0%BD,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC_%D0%94%D0%B6%D0%B5%D1%84%D1%84%D0%B5%D1%80%D1%81%D0%BE%D0%BD\" class=\"mw-redirect\" title=\"\u041a\u043b\u0438\u043d\u0442\u043e\u043d, \u0423\u0438\u043b\u044c\u044f\u043c \u0414\u0436\u0435\u0444\u0444\u0435\u0440\u0441\u043e\u043d\">\u041a\u043b\u0438\u043d\u0442\u043e\u043d\u0430<\/a> \u043f\u043e \u0432\u043e\u043f\u0440\u043e\u0441\u0443 \u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c \u0431\u044e\u0434\u0436\u0435\u0442\u0435 \u043d\u0430 1996 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0431\u043b\u043e\u043a\u0438\u0440\u0443\u0435\u0442 \u0434\u0432\u0435 \u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0435 \u0440\u0430\u0441\u0445\u043e\u0434\u043d\u044b\u0435 \u0441\u0442\u0430\u0442\u044c\u0438, \u0447\u0442\u043e \u043f\u0440\u0438\u0432\u043e\u0434\u0438\u0442 \u043a \u0437\u0430\u043a\u0440\u044b\u0442\u0438\u044e \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0432\u0442\u043e\u0440\u043e\u0441\u0442\u0435\u043f\u0435\u043d\u043d\u044b\u0445 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c, \u043d\u0430\u0447\u0438\u043d\u0430\u044f \u0441 14 \u0434\u0435\u043a\u0430\u0431\u0440\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 08:55. \u041a\u0430\u0434\u0443\u043d\u0430, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B3%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u041d\u0438\u0433\u0435\u0440\u0438\u044f\">\u041d\u0438\u0433\u0435\u0440\u0438\u044f<\/a>. \u0421\u0430\u043c\u043e\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Boeing_737\" title=\"Boeing 737\">\u0411\u043e\u0438\u043d\u0433 737<\/a> \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 Nigeria Airways \u043a\u0430\u0441\u0430\u0435\u0442\u0441\u044f \u0432\u0437\u043b\u0451\u0442\u043d\u043e-\u043f\u043e\u0441\u0430\u0434\u043e\u0447\u043d\u043e\u0439 \u043f\u043e\u043b\u043e\u0441\u044b \u043f\u043e\u0447\u0442\u0438 \u043d\u0430 \u0435\u0451 \u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0435, \u0441\u0432\u043e\u0440\u0430\u0447\u0438\u0432\u0430\u0435\u0442 \u0441 \u043f\u043e\u043b\u043e\u0441\u044b \u0432 \u0441\u0442\u043e\u0440\u043e\u043d\u0443, \u0438 \u043f\u043e\u0434 \u043d\u0438\u043c \u0437\u0430\u0433\u043e\u0440\u0430\u0435\u0442\u0441\u044f \u0442\u0440\u0430\u0432\u0430. \u0418\u0437 137 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442 9.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2000_%D0%B3%D0%BE%D0%B4\" title=\"2000 \u0433\u043e\u0434\">2000<\/a>&#160;\u2014 \u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0420\u0424 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%82%D0%B8%D0%BD,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0443\u0442\u0438\u043d, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u041f\u0443\u0442\u0438\u043d<\/a> \u0432\u044b\u0441\u0442\u0443\u043f\u0438\u043b \u0441 \u0437\u0430\u044f\u0432\u043b\u0435\u043d\u0438\u0435\u043c, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u043b \u0432 \u0431\u0443\u0434\u0443\u0449\u0435\u043c \u0441\u043d\u0438\u0437\u0438\u0442\u044c \u0443\u0440\u043e\u0432\u0435\u043d\u044c \u044f\u0434\u0435\u0440\u043d\u044b\u0445 \u0431\u043e\u0435\u0437\u0430\u043f\u0430\u0441\u043e\u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0438 \u0421\u0428\u0410. \u0412 \u0437\u0430\u044f\u0432\u043b\u0435\u043d\u0438\u0438 \u0440\u043e\u0441\u0441\u0438\u0